import React from "react";
import Register from "./components/Register";
import { BrowserRouter,Routes,Route } from 'react-router-dom';
import Home from "./pages/Home"


const App = () => {
  return (
    <BrowserRouter>
    <Routes>
      <Route exact path='/' Component={Home}></Route>
    </Routes>
    </BrowserRouter>
  );
}

export default App;
